		this.pDockerCompose = new DockerComposeElements();
		this.pService = new ServiceElements();
		this.pBuild = new BuildElements();
		this.pBuildLongSyntax = new BuildLongSyntaxElements();
		this.pDeployConfigs = new DeployConfigsElements();
		this.pDeployConfigsLongSyntax = new DeployConfigsLongSyntaxElements();
		this.pCredentialSpec = new CredentialSpecElements();
		this.pDeploy = new DeployElements();
		this.pPlacement = new PlacementElements();
		this.pRestartPolicy = new RestartPolicyElements();
		this.pConfig = new ConfigElements();
		this.pHealthcheck = new HealthcheckElements();
		this.pLogging = new LoggingElements();
		this.pPorts = new PortsElements();
		this.pPortLongSyntax = new PortLongSyntaxElements();
		this.pServiceSecrets = new ServiceSecretsElements();
		this.pServiceSecretsLongSyntax = new ServiceSecretsLongSyntaxElements();
		this.pUlimits = new UlimitsElements();
		this.pServiceVolumes = new ServiceVolumesElements();
		this.pServiceVolumeLongSyntax = new ServiceVolumeLongSyntaxElements();
		this.pVolumes = new VolumesElements();
